  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Prime
  Hook National Wildlife Refuge outlines Refuge accomplishments during the 1974 fiscal
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, mammals, raptors,
  fish, reptiles, and diseases- is also covered. The Refuge development and maintenance
  section discusses physical developments. Resource management is outlined; topics
  include grazing. A progress report on field investigations and applied research
  is also provided. The public relations section of the report describes hunting and
  violations. Items of interest, N-R forms, and photographs are included.\",\n\t\"owner_org\":
